def plot_data(dataset, metric, dmd_data, convlstm_data, ours_data, file_title):
    plt.figure(figsize=(12, 10))
    plt.plot(timestamps, dmd_data, label='DMD', marker='o', markersize=7)
    plt.plot(timestamps, convlstm_data, label='ConvLSTM', marker='s', markersize=7)
    plt.plot(timestamps, ours_data, label='Ours', marker='^', markersize=7)

    plt.legend(fontsize=23, markerscale=2)
    plt.xlabel('TimeStamp', fontsize=28)
    plt.ylabel(metric, fontsize=28)
    plt.tick_params(axis='both', which='major', labelsize=25)
    # plt.show()
    plt.savefig(f'C:/Users/76585/OneDrive/metting_exp_etl/exp/202311中文期刊投稿/英文期刊/{type_model}/{dataset}--{metric}--{file_title}.png', bbox_inches='tight', pad_inches=0.1)
    # plt.savefig(f'C:/Users/76585/OneDrive/metting_exp_etl/exp/202311中文期刊投稿/英文期刊/now/{dataset}--{metric}--{file_title}.png')
    plt.close()

for dataset in data:
    for metric in data[dataset]:
        dmd_data = data[dataset][metric]['DMD']
        convlstm_data = data[dataset][metric]['ConvLSTM']
        ours_data = data[dataset][metric]['Ours']
        plot_data(dataset, metric, dmd_data, convlstm_data, ours_data, metric)
